import React from 'react';
import {useSearchParams} from 'react-router-dom'

const Detail = () => {
  const {id, title, content} = useParams()
  return (
    <ul>
      <li>{id}</li>
      <li>{title}</li>
      <li>{content}</li>
    </ul>
  );
}

export default Detail;
